// import backgroundImg from './images/background.PNG'; // Adjust the path as per your project structure

const Home = () => {
  const handleShopNowClick = () => {
    // Handle click event for "Shop Now" button
    console.log('Shop Now button clicked');
  };

  return (
    <div className="container">
      <div className="text-content">
        <h1>Faith's Confectionery</h1>
        <p class="slogan">Delight every bite </p>
        <button className="btn btn-primary" onClick={handleShopNowClick}>Shop Now</button>
      </div>
      <div className="image-container">
        {/* <img src={backgroundImg} alt="Background" /> */}
      </div>
    </div>
  );
};

export default Home;
